import React, { useState } from "react";
import { useNavigate } from "react-router";

export default function Dashboard() {

    const navigate = useNavigate();

    function handleClick(route){
        if(route == 'create'){
            navigate('/create');
        }
        if(route == 'lookup'){
            navigate('/lookup');
        }
    }

    return(
        <>
            <h3>Hello! How can we help?</h3>
            <br/>
            <button className="btn btn-primary" onClick={handleClick('create')}>Create Ticket</button>
            <button className="btn btn-primary" onClick={handleClick('lookup')}>Ticket Lookup</button>
        </>
    );

}
